const AddNote = () => {
    return(
        <div className="new-note">
            <textarea rows="8" cols="10" placeholder="Add a new note"></textarea>
            <div className="note-footer">
                <small>200 Remaining</small>
                <button className="save">Add Note</button>
            </div>
        </div>
    )
}

export default AddNote
